    <div className="eachRecipe">

      <a href={hlink} ><h3 >{title} </h3></a>  <br/>
    <p><b>Phone number:</b> {phno}</p><br/>
      <p><b>Rating:</b> {rating}</p><br/>
      <p><b>Cusines:</b> {cuisines}</p><br/>
